import axios from 'axios'
import { Handler } from '../../types/types'
const $http = axios.create({
  // baseURL: '/api',
  timeout: 20000
})

const glToken =
  ''
export const addModel: Handler = async (req, res) => {
  try {
    axios
      .request({
        method: 'post',
        url: 'http://10.0.33.81:8087/api/app/model/SplitUploadFile',
        data: req.body,
        headers: {
          Token: glToken, //本地开发token内容复制至此
          'Content-Type': 'multipart/form-data'
        }
      })
      .then(axiosRes => {
        console.log('res', axiosRes)
        res.status(200).send(axiosRes)
      })
      .catch(error => {
        console.log('error', error)
        res.status(404).send(error)
      })
    // res.status(200).send('ok')
    // res.status(200).send(data)
  } catch (error) {
    return res.status(401).send(error)
  }
}
